function HomePage() {
    return (
        <BrowserRouter>
            <div>
                <h1> Mlebu Disek </h1>
                <hr/>
                <Link>Sign In</Link>
                <p>or</p>
                <Link>Sign Out</Link>
                <p>Silakan dipilih Guys</p>
            </div>
        </BrowserRouter>

    )
}

export default HomePage
